import React from "react";
import { BrowserRouter, Route } from 'react-router-dom';
import Home from "./components/Home"

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <h1>Hello React Router</h1>
        <Route path="/Home">
          <Home />
        </Route>
      </BrowserRouter>
    );
  }
}

export default App;
